local function rdStr()
  local len=rd()
  local t={}
  for i=1,len do t[i]=string.char(rd()) end
  return table.concat(t)
end

-- VM loop
while true do
  local op=rd()
  if op==OP.PRINT then
    local arg=rdStr()
    -- very safe eval for print only
    if string.sub(arg,1,1)=='"' then
      print(arg:sub(2,-2))
